	// 读取请求资源
	public function readDatabaseResource() {
		
		// 获取路径
		$arr_key = array_keys($_GET);
		$url = $arr_key[0];
		$tmp_str_1 = rtrim($url, '/*');
		$tmp_str_2 = ltrim($tmp_str_1, '/gj/index/details/');
		$str = explode('/', $tmp_str_2);
		$book_id = $str[0];
		$page_id = sprintf("%04d", $str[1]-1); //生成4位数，不足前面补0   位数可自己设置 
		
		// echo $page_id;
		// return 123;
			
		$condition = array( 'id'=>$book_id );
		$result = $this->model->where( $condition )->find();

		$path = $result['file_path'].'/'.$result['title'].'/'.$page_id.'.jpg';

		$image = $this->readImage($path);

		$json_result = $this->returnJson($result['title'], $image, 'jpg', $result['count_page'], $page_id);

		return $json_result;


	}

